> Political Obama focusing on condolences, not gun laws, in Oregon visit FILE - In this Oct. 1, 2015 file photo, authorities respond to a shooting at Umpqua Community College in Roseburg, Ore. When President Barack Obama arrives in Roseburg Friday, Oct. 9, 2015, he will find a timber town still in mourning over the shooting that killed eight community college students and a teacher. But he will also find another deeply held emotion--seething anger over his calls for new gun restrictions. (Michael Sullivan /The News-Review via AP, File) MANDATORY CREDIT 
